import { FlatList, View } from "react-native";

import { CATEGORIES } from "../data/dummy-data";

const CategoriesScreen = () => {
    return (
        <View>
            <h1>CategoriesScreen</h1>
            <FlatList data={CATEGORIES} />
        </View>
    );
};

export default CategoriesScreen;
